import React from 'react'

const Card = ({data}) => {
  return (
    <>
    {data.map((card, index)=>{
        <div className="card">
            <h1>{card.title}</h1>
            <p>{card.descrption}</p>
        </div>
    })
    }}
    </>
  )
}

export default Card
